import styled from "styled-components";


export const HeaderBlock = styled.div`
    width: 100%;
    height: 100px;  
    background-color:skyblue;
`;

export const HeaderSection = styled.div`
  width: 100%;
  height: 50px;
  position: relative;
`;
export const HeaderSectionText = styled.span`
  left:12%;
  top: calc(50% - 1em / 2);
  position: absolute;
  font-size: 1.3em;
`;
